        "channelId": "UCUny6duOITs1W1L4KP2N2Rw",
        "title": "Heli Snowboarding with Travis Rice",
        "description": "PLEASE READ! Before you ask questions. \nI do not own the rights to this song!!! this song is by, Unlimited Gravity Remix-Sail\n\nIn February of last year i was granted a Make-A-Wish. Make-A-Wish is an organization that has enriched the lives of children with life-threatening medical conditions through its wish-granting work. The Foundation's mission reflects the life-changing impact that a Make-A-Wish¬Æ experience has on children, families, referral sources, donors, sponsors and entire communities.\n\nI was born with 2 bad kidneys and had to have a transplant at age 3. I was lucky enough to have had my mom give me one of her kidneys. I am now 19 years old. Living life to the fullest. I love to snowboard, wakeboard, bmx, film, and hang out with my friends. \n\nIn June of 2011 I was given the opportunity to have a Make-A-Wish. My first wish was to go to Jackson Hole Ski Resort and snowboard with pro snowboarder, Travis Rice. I was also given the pleasure in bringing one of my best friends who has been by my side when I'm sick, and helped me through the years of being ill. So I brought my good friend D.J. (The one with the white pov helmet) This took about 8 months to finally happen. I found out in the beginning of February 2012 that my wish would be coming true. Not only that but it would be happening in only 2 weeks. So I started to pack up and get ready for the big trip. When we got to Jackson Hole we got to ride for the day. Then met Travis and rode again. He graciously extend our trip so he could surprise us and take us Heli skiing. Thanks to the help High Mountian Heli! He gave us Contour cams so we could film the whole thing. SO in the end, this is the ONLY PART of the day Heli Snowboarding. I had much more film. I know I'm not the best editor or snowboarder but it was a great time! THANK YOU TRAVIS RICE!! You are the nicest, most down to earth real person I have had the pleasure of meeting.",
